def display_incorrect_rnn(model, val, val_vect):
  correct = 0
  incorrect = []
  inc = 0 
  total = 0
  emotions = np.zeros(6)
  emotions_total = np.ones(6)

  for i, v in enumerate(val_vect): 
    input_batch, expected_out, len_doc = v
    input_concat = input_batch[:len_doc, :].unsqueeze(0)
    output = model(input_concat.to(get_device()))
    total += output.size()[0]
    predicted = torch.argmax(output)
    if (predicted == expected_out): 
      correct+= 1
      emotions[expected_out] += 1
    else: 
      incorrect.append((val[i], predicted))
    emotions_total[expected_out] += 1
  
  print("% correct:" + str((correct/total)*100) + "%")
  print("% correct anger:" + str((emotions[0]/emotions_total[0])*100) + "%")
  print("% correct fear:" + str((emotions[1]/emotions_total[1])*100) + "%")
  print("% correct joy:" + str((emotions[2]/emotions_total[2])*100) + "%")
  print("% correct love:" + str((emotions[3]/emotions_total[3])*100) + "%")
  print("% correct sadness:" + str((emotions[4]/emotions_total[4])*100) + "%")
  print("% correct surprise:" + str((emotions[5]/emotions_total[5])*100) + "%")
  print("\n")
  print("example incorrect sentences")
  
  for i in range(5): 
    v, p = incorrect[i]
    print("sentence:")
    print(*v[0])
    print("expected:" + idx_to_emotion[int(v[1])])
    print("predicted:" + idx_to_emotion[int(p)])
    print("\n")
  pass

display_incorrect_rnn(model_rnn, val, val_vect_rnn)

# Performs a qualitative comparison of the RNN and FFNN models by examining specific
# examples of input sentences along with the correct output vs RNN vs FFNN
def display_incorrect_comparison(model_rnn, model_ffnn, val, val_vect_rnn, val_vect):
  correct = 0
  incorrect = []
  incorrect_ffnn = []
  incorrect_rnn = []
  bothcorrect = []
  idx = 0
  while len(incorrect) < 5 or len(incorrect_ffnn) < 5 or len(incorrect_rnn) < 5:  
    input_batch, expected_out, len_doc = val_vect_rnn[idx]
    input_concat = input_batch[:len_doc, :].unsqueeze(0)

    output_rnn = model_rnn(input_concat.to(get_device()))
    output_ffnn = model_ffnn(val_vect[idx][0].to(get_device()).unsqueeze(0))

    predicted_rnn = torch.argmax(output_rnn)
    predicted_ffnn = torch.argmax(output_ffnn)

    if (predicted_rnn == expected_out and predicted_ffnn == expected_out): 
      correct+= 1
      bothcorrect.append((val[idx], predicted_rnn, predicted_ffnn))
    elif (predicted_rnn == expected_out): 
      incorrect_ffnn.append((val[idx], predicted_rnn, predicted_ffnn))
    elif (predicted_ffnn == expected_out):
      incorrect_rnn.append((val[idx], predicted_rnn, predicted_ffnn))
    else: 
      incorrect.append((val[idx], predicted_rnn, predicted_ffnn))
    idx+=1
  
  print("BOTH INCORRECT")
  for i in range(5): 
    v, r, f = incorrect[i]
    print(*v[0])
    print("Expected:" + idx_to_emotion[int(v[1])])
    print("RNN:" + idx_to_emotion[int(r)])
    print("FFNN:" + idx_to_emotion[int(f)])
    print("\n")

  print("CORRECT RNN, INCORRECT FFNN")
  for i in range(5): 
    v, r, f = incorrect_ffnn[i]
    print(*v[0])
    print("Expected:" + idx_to_emotion[int(v[1])])
    print("RNN:" + idx_to_emotion[int(r)])
    print("FFNN:" + idx_to_emotion[int(f)])
    print("\n")

  print("INCORRECT RNN, CORRECT FFNN")
  for i in range(5): 
    v, r, f = incorrect_rnn[i]
    print(*v[0])
    print("Expected:" + idx_to_emotion[int(v[1])])
    print("RNN:" + idx_to_emotion[int(r)])
    print("FFNN:" + idx_to_emotion[int(f)])
    print("\n")

  print("BOTH CORRECT")
  for i in range(5): 
    v, r, f = bothcorrect[i]
    print(*v[0])
    print("Expected:" + idx_to_emotion[int(v[1])])
    print("RNN:" + idx_to_emotion[int(r)])
    print("FFNN:" + idx_to_emotion[int(f)])
    print("\n")
  pass

