"""**Description and Fairness Argument**

Momentum is a hyperparameter that controls how much the model allows previous updates to influence the current weight. As discussed by Sutskever et al. in their paper "On the importance of initialization and momentum in deep learning", it is a technique for controlling and accelerating gradient descent, which improves RNNs ability to handle long-distance dependencies and the vanishing gradient problem. (Sutskever et al.) Increasing momentum allows RNNs to avoid falling into local extrema and train towards poor results. RNNs have difficulties with long-distance dependencies, as discussed in Part 4. For example, let's say there is a really sad word at the beginning of a sentence, and it's crucial for understanding the overall tone. The RNN model will detect that strong word at the beginning, but the strong signal will get weaker within the hidden state due to the repeated dot products applied to the gradient, leading to a vanishing gradient problem. Therefore, as the RNN progresses through that sentence, the output will become less and less sad due to the dependency on an early word. In contrast, FFNNs learn at a more constant rate and don't fall into these local extrema. That strong sad word at the beginning would have a consistent effect throughout. 

Therefore, in order to create a fair configuration, we need to even out this momentum value in a way that makes the comparison more equal. We need to lower the momentum of the FFNN model. Previously, this value was set to 0.9 within the train_and_evaluate() function. We lowered this to 0.1 in order to significantly decrease the momentum of the FFNN, but kept the momentum value of our RNN at 0.9, which is the default within the Adam optimizer function. We realize that this is a large difference in momentum values (0.1 to 0.9). However, because the RNN tends to fall into local extrema, unlike the FFNN, we argue that it makes sense to set these values to opposite ends of the spectrum in order to truly compare the two models without worrying about the vanishing gradient problem, which does not occur during the FFNN. Making the momentum for RNN higher than FFNN should lead to a fairer comparison, as it will help the RNN avoid the local extrema that the FFNN already avoids, so the two models will both learn at more of a constant and similar rate.

**Results**

When keeping all hyperparameters the same (5 epochs, h=512, 2 hidden layers) and changing the momentum of each model (0.1 for FFNN, 0.9 for RNN), we see accuracies of:


*   FFNN: ~49.8%
*   RNN: ~51.4%

Based on the accuracies above, we can see that significantly decreasing the momentum for the FFNN model while holding the RNN momentum consistent significantly equalizes their performance to nearly identical accuracies after 5 epochs.
"""

display_incorrect_comparison(rnn_config_1, ffnn_config_1, val, val_vect_rnn, val_vectorized)

